@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:BankComputer a owl:Class .
atm:ATM a owl:Class .
atm:Password a owl:Class .
atm:Message a owl:Class .

atm:hasPassword a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Password .

atm:sendMessage a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:ATM .

atm:indicates a owl:ObjectProperty ;
  rdfs:domain atm:Message ;
  rdfs:range atm:Password .

atm:BadPassword a owl:Class ;
  rdfs:subClassOf atm:Password .

atm:InvalidPassword a owl:Class ;
  rdfs:subClassOf atm:BadPassword .

atm:BadPasswordMessage a owl:Class ;
  rdfs:subClassOf atm:Message ;
  rdfs:subClassOf [ a owl:Restriction ;
    owl:onProperty atm:indicates ;
    owl:someValuesFrom atm:BadPassword
  ] .

[ a owl:Class ;
  owl:equivalentClass [ a owl:Restriction ;
    owl:onProperty atm:sendMessage ;
    owl:someValuesFrom atm:BadPasswordMessage
  ]
] rdfs:subClassOf atm:BankComputer .
